import Repository from "./repository";

class UserRepository {
    //gell all clients
    async GetAllClients() {
      const response = await Repository.post("/admin/settings")
        .then((response) => {
          return response;
        })
        .catch((error) => {
          console.log(error);
          return error;
        });
      return response;
    }
  
}
  export default new UserRepository();
